  [],\n\t\"revision_timestamp\": \"2016-07-27T22:51:32.449954\",\n\t\"name\": \"pacific-flyway-management-plan-for-pacific-brant\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Pacific Flyway brant (Branta bernicla)
  population (PFBP) is made up of brant breeding in Alaska, the western Canadian arctic,
  and the eastern Russian arctic, and wintering primarily along the Pacific Coast
  from Alaska to Mexico (Figure 1). In 1978 the Pacific Flyway Council implemented
  the first Pacific Brant Management Plan. The plan was revised in 1981 and 1992.The
  PFBP breeds in Alaska, Canada and Russia (Appendix A) and is subdivided into two
  management units. Black brant predominate, breeding primarily in Alaska, the low
  Arctic of western Canada, and northeastern Russia (Palmer 1976, Banikov et al. 1983).
  Western High Arctic (WHA) brant breed on the Parry Islands in Northwest Territories
  and exhibit plumage characteristics ranging from the light gray breast and belly
  feathers of Atlantic brant to the black breast and belly feathers of black brant
  (Boyd and Maltby 1979). Most of the WHA population is composed of the lighter and
  intermediate plumage types.The WHA population is currently distinguished from other
  North American brant populations (Boyd and Maltby 1979, Boyd and Maltby 1980, Boyd
  et al. 1988, Reed et al. 1989a, Reed et al. 1998). Genetic comparisons suggest the
  population may be reproductively isolated from black brant and Atlantic brant and
  comprise a separate stock with no subspecies designation (Shields 1990). This plan
  recognizes the separate status of WHA brant for management purposes. It is recognized
  that the PFBP is a resource shared among the people of the United States, Canada,
  Mexico, Russia, and Japan. As such, a cooperative effort has been and will continue
  to be required for sound management.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
